                    }
                }
                response = await this.sapiGetMarginOpenOrders(this.extend(request, parameters));
            }
        } else
        {
            response = await this.privateGetOpenOrders(this.extend(request, parameters));
        }
        return this.parseOrders(response, market, since, limit);
    }

