        } else if (isTrue(getValue(market, "inverse")))
        {
            response = await this.dapiPublicGetOpenInterest(this.extend(request, parameters));
        } else
        {
            response = await this.fapiPublicGetOpenInterest(this.extend(request, parameters));
        }
        //
